title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o8765.m0 -> o8764.m26 -> o8765.m0
  o8764.m12 -> o8765.m0 -> o8764.m26 -> o8765.m0
  o8764.m26 -> o8765.m0 -> o8764.m26
  o8802.m28 -> o8802.m25 -> o8732.m9 -> o8802.m25
  o8802.m18 -> o8802.m14 -> o8732.m13 -> o8802.m30 -> o8732.m9 -> o8802.m25 -> o8732.m9
  o8802.m21 -> o8732.m13 -> o8802.m30 -> o8732.m9 -> o8802.m25 -> o8732.m9
  o8732.m9 -> o8802.m25 -> o8732.m9
  o8802.m30 -> o8732.m9 -> o8802.m25 -> o8732.m9
  o8802.m25 -> o8732.m9 -> o8802.m25
  o8732.m12 -> o8802.m25 -> o8732.m9 -> o8802.m25
  o8802.m14 -> o8732.m13 -> o8802.m30 -> o8732.m9 -> o8802.m25 -> o8732.m9
  o8732.m13 -> o8802.m30 -> o8732.m9 -> o8802.m25 -> o8732.m9

features:
  - inheritance
  - overriding
  - method
  - polymorphism

